import React, {useState,memo,useToggle}from 'react'
const SomeBigComponent = memo(({ toggleIsOn }) => {
  // Imagine lots of stuff here
});
export const Test = () => {
  const [isOn, toggleIsOn] = useToggle();
  const [count, setCount] = useState(0);
  return (
    <>
      The lights are {isOn ? 'on' : 'off'} and you've
      clicked {count} time(s).
      <button onClick={() => setCount(s => s + 1)}>
        Increment
      </button>
      <SomeBigComponent toggleIsOn={toggleIsOn} />
    </>
  )
}
